import React from "react";
import { Stack, Box } from "@mui/material";

const Videos = ({ videos }) => {
  return (
    <Stack
      direction="row"
      flexWrap="wrap"
      justifyContent="start"
      gap={2}
    >

        {videos.map((video))}
    </Stack>
  );
};

export default Videos;
